  `kode_kandidat_wilayah_pasar` int(11) NOT NULL AUTO_INCREMENT,
  `kode_wilayah_pasar` int(11) NOT NULL,
  `kode_periode_penilaian` int(11) NOT NULL,
  `status_kandidat` enum('Ya','Tidak','Dalam Proses') NOT NULL,
  `status_pemilihan` enum('Ya','Tidak','Dalam Proses') NOT NULL,
  `status_segmentasi` enum('Dalam Proses','Sudah','Belum') NOT NULL,
  `hasil_penilaian` float NOT NULL,
  PRIMARY KEY (`kode_kandidat_wilayah_pasar`),
  KEY `kode_wilayah_pasar` (`kode_wilayah_pasar`),
  KEY `kode_periode_penilaian` (`kode_periode_penilaian`),
  CONSTRAINT `kandidat_wilayah_pasar_ibfk_1` FOREIGN KEY (`kode_wilayah_pasar`) REFERENCES `wilayah_pasar` (`kode_wilayah_pasar`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `kandidat_wilayah_pasar_ibfk_2` FOREIGN KEY (`kode_periode_penilaian`) REFERENCES `periode_penilaian` (`kode_periode_penilaian`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `kandidat_wilayah_pasar` */

/*Table structure for table `kriteria_penilaian_segmentasi` */

DROP TABLE IF EXISTS `kriteria_penilaian_segmentasi`;

CREATE TABLE `kriteria_penilaian_segmentasi` (
  `kode_kriteria_penilaian_segmentasi` int(11) NOT NULL AUTO_INCREMENT,
  `nama_kriteria_penilaian_segmentasi` varchar(255) NOT NULL,
  `bobot_kriteria_penilaian_segmentasi` float NOT NULL,
  `kategori_kriteria_penilaian_segmentasi` enum('Belum Ditentukan','Cost','Benefit') DEFAULT NULL,
  `status` enum('Aktif','Tidak Aktif') NOT NULL,
  PRIMARY KEY (`kode_kriteria_penilaian_segmentasi`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;

