/*Table structure for table `nilai_wilayah_pasar` */

DROP TABLE IF EXISTS `nilai_wilayah_pasar`;

CREATE TABLE `nilai_wilayah_pasar` (
  `kode_nilai_wilayah_pasar` int(11) NOT NULL AUTO_INCREMENT,
  `kode_kriteria_penilaian_segmentasi` int(11) NOT NULL,
