  `nilai_alternatif` float NOT NULL,
  PRIMARY KEY (`kode_nilai_wilayah_pasar`),
  KEY `kode_kriteria_penilaian_segmentasi` (`kode_kriteria_penilaian_segmentasi`),
  KEY `kode_wilayah_pasar` (`kode_kandidat_wilayah_pasar`),
  CONSTRAINT `nilai_wilayah_pasar_ibfk_3` FOREIGN KEY (`kode_kriteria_penilaian_segmentasi`) REFERENCES `kriteria_penilaian_segmentasi` (`kode_kriteria_penilaian_segmentasi`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `nilai_wilayah_pasar_ibfk_5` FOREIGN KEY (`kode_kandidat_wilayah_pasar`) REFERENCES `kandidat_wilayah_pasar` (`kode_kandidat_wilayah_pasar`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

