/*Table structure for table `pemberitahuan` */

DROP TABLE IF EXISTS `pemberitahuan`;

CREATE TABLE `pemberitahuan` (
  `kode_pemberitahuan` int(11) NOT NULL AUTO_INCREMENT,
  `id_pengguna` int(11) DEFAULT NULL,
  `kode_transaksi_pemesanan` varchar(16) DEFAULT NULL,
  `pemberitahuan` text NOT NULL,
  `terbaca` enum('Sudah','Belum') NOT NULL,
  `validator_pelanggan` float DEFAULT NULL,
  `validator_tahunan` date DEFAULT NULL,
  `waktu_update` datetime NOT NULL,
  PRIMARY KEY (`kode_pemberitahuan`),
  KEY `id_pengguna` (`id_pengguna`),
  KEY `kode_transaksi_pemesanan` (`kode_transaksi_pemesanan`),
  CONSTRAINT `pemberitahuan_ibfk_1` FOREIGN KEY (`id_pengguna`) REFERENCES `pengguna` (`id_pengguna`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `pemberitahuan_ibfk_2` FOREIGN KEY (`kode_transaksi_pemesanan`) REFERENCES `transaksi_pemesanan` (`kode_transaksi_pemesanan`) ON DELETE CASCADE ON UPDATE CASCADE
