/*Table structure for table `wilayah_pasar` */

DROP TABLE IF EXISTS `wilayah_pasar`;

CREATE TABLE `wilayah_pasar` (
  `kode_wilayah_pasar` int(11) NOT NULL AUTO_INCREMENT,
  `id_pengguna` int(11) NOT NULL,
  `nama_wilayah_pasar` varchar(128) NOT NULL,
  `keterangan` text NOT NULL,
  `lat` varchar(255) NOT NULL,
  `lng` varchar(255) NOT NULL,
  `status` enum('Aktif','Tidak Aktif') NOT NULL,
  PRIMARY KEY (`kode_wilayah_pasar`),
  KEY `id_pengguna` (`id_pengguna`),
  CONSTRAINT `wilayah_pasar_ibfk_1` FOREIGN KEY (`id_pengguna`) REFERENCES `pengguna` (`id_pengguna`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=46 DEFAULT CHARSET=latin1;

